{"translationLines":[{"lineNumber":55971,"originalJapaneseLine":"「良き旅であったようですな」","translatedEnglishLine":"\"It seems you had a good journey.\""},{"lineNumber":55972,"originalJapaneseLine":"満足そうに頷く老魔術師に、","translatedEnglishLine":"To the satisfied nodding old magician,"},{"lineNumber":55973,"originalJapaneseLine":"黄金の騎士は僅かに唇を歪めただけで応えた。","translatedEnglishLine":"the Golden Knight responded with only a slight twist of his lips."},{"lineNumber":55974,"originalJapaneseLine":"「さぁ、引き上げて防衛の準備を整えるぞ。","translatedEnglishLine":"\"Now, let's pull back and prepare our defenses."},{"lineNumber":55975,"originalJapaneseLine":"　易々と負けては、あいつらに向ける顔がない」","translatedEnglishLine":"We can't afford to lose so easily; we wouldn’t be able to face them.\""},{"lineNumber":55976,"originalJapaneseLine":"ランス一行と別れた黄金の一団は、","translatedEnglishLine":"The band of gold parted ways with Rance’s group,"},{"lineNumber":55977,"originalJapaneseLine":"颯爽とパランチョ王国への帰途に就いた。","translatedEnglishLine":"and gallantly set off on their return to the Kingdom of Paranch."},{"lineNumber":55978,"originalJapaneseLine":"「なんだ？　この街は…………」","translatedEnglishLine":"\"What is this? This town...\""},{"lineNumber":55979,"originalJapaneseLine":"「火星というそうですよ、ランス様……」","translatedEnglishLine":"\"They say it’s called Mars, Lord Rance...\""},

{"lineNumber":55980,"originalJapaneseLine":"「おっと旅するそこの方。","translatedEnglishLine":"\"Hey, traveler over there."},

{"lineNumber":55981,"originalJapaneseLine":"　ここは火星じゃないぜ」","translatedEnglishLine":"This isn’t Mars.\""},{"lineNumber":55982,"originalJapaneseLine":"「えっ？」","translatedEnglishLine":"\"Huh?\""},{"lineNumber":55983,"originalJapaneseLine":"「王であらせられる火星大王様が、","translatedEnglishLine":"\"The great King Mars, who was your king,"},{"lineNumber":55984,"originalJapaneseLine":"　神になられたからな。","translatedEnglishLine":"has become a god."},{"lineNumber":55985,"originalJapaneseLine":"　それで今は、火星スターって名前なんだ」","translatedEnglishLine":"So now, he goes by the name Mars Star.\""},{"lineNumber":55986,"originalJapaneseLine":"「はぁ……ご丁寧にどうも……」","translatedEnglishLine":"\"I see... thank you for your courtesy...\""},{"lineNumber":55987,"originalJapaneseLine":"「はっはっは〜。ま〜べら〜〜す」","translatedEnglishLine":"\"Ha ha ha~ marvelous~~\""},{"lineNumber":55988,"originalJapaneseLine":"男は去っていった。","translatedEnglishLine":"The man then walked away."},{"lineNumber":55989,"originalJapaneseLine":"「…………なんだか分からんが、","translatedEnglishLine":"\"...I don’t really get it, but"},{"lineNumber":55990,"originalJapaneseLine":"　変な街っぽいのはわかった」","translatedEnglishLine":"I understand this town seems strange.\""},{"lineNumber":55991,"originalJapaneseLine":"「うちもこの辺全然来ぉへんからなぁ……","translatedEnglishLine":"\"I don’t come around here at all either..."},{"lineNumber":55992,"originalJapaneseLine":"　よーわからんわ」","translatedEnglishLine":"I really don’t understand it.\""},{"lineNumber":55993,"originalJapaneseLine":"「お兄さん、お兄さん。","translatedEnglishLine":"\"Hey big brother, hey big brother."},{"lineNumber":55994,"originalJapaneseLine":"　上限レベル低そうな顔してるね」","translatedEnglishLine":"You look like someone with a low level cap.\""},{"lineNumber":55995,"originalJapaneseLine":"「なな、なんだすか！？」","translatedEnglishLine":"\"W-What are you talking about!?\""},{"lineNumber":55996,"originalJapaneseLine":"「うちの宿、スターアンテナあるの。","translatedEnglishLine":"\"Our inn has a Star Antenna."},{"lineNumber":55997,"originalJapaneseLine":"　スターレベル様のお墨付き。上限上がるよ」","translatedEnglishLine":"It's certified by the Star Level lord. Your cap will increase.\""},{"lineNumber":55998,"originalJapaneseLine":"「え、あ、上がるんだすか？」","translatedEnglishLine":"\"Eh, um, it really will increase?\""},{"lineNumber":55999,"originalJapaneseLine":"「そりゃもう。","translatedEnglishLine":"\"Of course."},{"lineNumber":56000,"originalJapaneseLine":"　ついでに色々、サービスしちゃうよ？」","translatedEnglishLine":"And besides, I’ll give you lots of other services.\""},{"lineNumber":56001,"originalJapaneseLine":"客引きの女性は色っぽく、ロッキーに囁いた。","translatedEnglishLine":"The female tout whispered seductively to Rocky."},{"lineNumber":56002,"originalJapaneseLine":"「う、ううう、そ、それは……ええと……」","translatedEnglishLine":"\"U-Um, th-that is... um...\""},{"lineNumber":56003,"originalJapaneseLine":"「おっと！　うちの宿も由緒正しいぞい！","translatedEnglishLine":"\"Oh! Our inn is also quite reputable!"},{"lineNumber":56004,"originalJapaneseLine":"　スターレベル様が直接浸かったスターの湯！","translatedEnglishLine":"The Star Bath where the Star Level lord himself once bathed!"},{"lineNumber":56005,"originalJapaneseLine":"　運が良ければレベルがぽーんと！」","translatedEnglishLine":"With some luck, your level will jump up instantly!\""},{"lineNumber":56006,"originalJapaneseLine":"「え、え、え？」","translatedEnglishLine":"\"Eh, eh, eh?\""},{"lineNumber":56007,"originalJapaneseLine":"「待ちな！　そっちの兄さん、","translatedEnglishLine":"\"Wait! Hey you over there,"},{"lineNumber":56008,"originalJapaneseLine":"　本当に足りてないのは技能じゃないのかい！","translatedEnglishLine":"Isn’t what you really lack skill?\""},{"lineNumber":56009,"originalJapaneseLine":"　そんなツラだ！」","translatedEnglishLine":"That's the kind of face you have!\""},{"lineNumber":56010,"originalJapaneseLine":"「ううっ、初対面の人たちに……！」","translatedEnglishLine":"\"Ugh, from people I just met...!\""},{"lineNumber":56011,"originalJapaneseLine":"「ロッキーさん、もてもて……」","translatedEnglishLine":"\"Rocky-san, popular, popular...\""},{"lineNumber":56012,"originalJapaneseLine":"「う、嬉しくないだすーー！」","translatedEnglishLine":"\"I-I’m not happy about thisーー!\""},{"lineNumber":56013,"originalJapaneseLine":"「……なんだなんだ。ここは…………」","translatedEnglishLine":"\"...What is this place...?"},{"lineNumber":56014,"originalJapaneseLine":"「体験してみれば分かりますよ。","translatedEnglishLine":"\"You’ll understand once you experience it."},{"lineNumber":56015,"originalJapaneseLine":"　ここだけの話、他のレベル神には内緒で……」","translatedEnglishLine":"Between you and me, it’s a secret from the other Level Gods...\""},{"lineNumber":56016,"originalJapaneseLine":"「…………内緒で、なんですか……？」","translatedEnglishLine":"\"...A secret, you say...?\""},{"lineNumber":56017,"originalJapaneseLine":"顔を引きつらせて、ウィリスが顕現していた。","translatedEnglishLine":"With a strained expression, Willis manifested."},{"lineNumber":56018,"originalJapaneseLine":"「おっ、ウィリス」","translatedEnglishLine":"\"Oh, Willis.\""},{"lineNumber":56019,"originalJapaneseLine":"「ひっ、レベル神！？」","translatedEnglishLine":"\"Eek, a Level God!?\""},{"lineNumber":56020,"originalJapaneseLine":"「あなた方……それは客引きの為の","translatedEnglishLine":"\"You all... that is for the purpose of touting...\""}]}

